INSERT INTO `crs_lecon` VALUES (323,58,'Quâ€™est-ce que la finance ?','<p><br></p><div class=\"subheader\" style=\"padding: 4px 0px 0px; margin-bottom: 60px; background-size: cover; position: relative; background-color: rgb(97, 117, 172); background-repeat: no-repeat; color: rgb(33, 37, 41); font-family: Poppins, sans-serif; font-size: 14px; background-position: center top;\"><div class=\"container\" style=\"width: 720px; max-width: 720px;\"><h1 class=\"title\" style=\"margin-top: 0px; margin-bottom: 0.5rem; line-height: 1.2; font-size: 2.5rem; z-index: 1; position: relative; color: rgb(255, 255, 255) !important;\">Quâ€™est-ce que la finance ?</h1></div></div><div class=\"container\" style=\"width: 720px; max-width: 720px; color: rgb(33, 37, 41); font-family: Poppins, sans-serif; font-size: 14px;\"><div class=\"row\" style=\"display: flex; flex-wrap: wrap;\"><div class=\"post-data col-md-9 col-lg-9 col-xs-12\" style=\"width: 540px; flex: 0 0 75%; max-width: 75%;\"><div class=\"post-thumb text-center\" style=\"margin-bottom: 20px;\"><img width=\"880\" height=\"300\" src=\"https://www.ingenieriefinanciere.fr/wp-content/uploads/2017/05/Qu%E2%80%99est-ce-que-la-finance-.jpg\" class=\"attachment-post-large size-post-large wp-post-image entered lazyloaded\" alt=\"la finance\" decoding=\"async\" data-lazy-srcset=\"https://www.ingenieriefinanciere.fr/wp-content/uploads/2017/05/Quâ€™est-ce-que-la-finance-.jpg 880w, https://www.ingenieriefinanciere.fr/wp-content/uploads/2017/05/Quâ€™est-ce-que-la-finance--300x102.jpg 300w, https://www.ingenieriefinanciere.fr/wp-content/uploads/2017/05/Quâ€™est-ce-que-la-finance--768x262.jpg 768w, https://www.ingenieriefinanciere.fr/wp-content/uploads/2017/05/Quâ€™est-ce-que-la-finance--260x89.jpg 260w, https://www.ingenieriefinanciere.fr/wp-content/uploads/2017/05/Quâ€™est-ce-que-la-finance--50x17.jpg 50w, https://www.ingenieriefinanciere.fr/wp-content/uploads/2017/05/Quâ€™est-ce-que-la-finance--150x51.jpg 150w\" data-lazy-sizes=\"(max-width: 880px) 100vw, 880px\" data-lazy-src=\"https://www.ingenieriefinanciere.fr/wp-content/uploads/2017/05/Quâ€™est-ce-que-la-finance-.jpg\" data-ll-status=\"loaded\" sizes=\"(max-width: 880px) 100vw, 880px\" srcset=\"https://www.ingenieriefinanciere.fr/wp-content/uploads/2017/05/Quâ€™est-ce-que-la-finance-.jpg 880w, https://www.ingenieriefinanciere.fr/wp-content/uploads/2017/05/Quâ€™est-ce-que-la-finance--300x102.jpg 300w, https://www.ingenieriefinanciere.fr/wp-content/uploads/2017/05/Quâ€™est-ce-que-la-finance--768x262.jpg 768w, https://www.ingenieriefinanciere.fr/wp-content/uploads/2017/05/Quâ€™est-ce-que-la-finance--260x89.jpg 260w, https://www.ingenieriefinanciere.fr/wp-content/uploads/2017/05/Quâ€™est-ce-que-la-finance--50x17.jpg 50w, https://www.ingenieriefinanciere.fr/wp-content/uploads/2017/05/Quâ€™est-ce-que-la-finance--150x51.jpg 150w\" style=\"border-style: none; width: auto; height: auto; max-width: 100%;\"></div><div class=\"blog-post-content\"><p style=\"margin-bottom: 1rem; text-align: justify;\">Que ce soit au sein dâ€™une entreprise, dâ€™une association ou dâ€™un organisme, le dÃ©partement financier est toujours incontournable. En effet, il a pour principal objectif dâ€™optimiser les dÃ©penses et dâ€™assurer que les ressources en main soient suffisantes pour payer les diverses charges.<span id=\"more-93\"></span></p><h2 style=\"margin-top: 0px; margin-bottom: 0.5rem; line-height: 1.2; color: rgb(0, 0, 0); text-align: justify; font-size: 22px !important;\">Zoom sur le terme Â« Finance Â»</h2><p style=\"margin-bottom: 1rem; text-align: justify;\">La finance permet de jongler entre prise de dÃ©cision, mise en Å“uvre et crÃ©ation de valeur. En bref, elle consiste donc Ã  :</p><ul style=\"margin-bottom: 1rem; padding-left: 0px; text-align: justify;\"><li>Sâ€™assurer que les dÃ©cisions prises vont engendrer des&nbsp;<span style=\"font-weight: bolder;\">plus-values</span></li><li>Mettre en place un&nbsp;<span style=\"font-weight: bolder;\">plan financier prÃ©visionnel</span></li><li>Faciliter la&nbsp;<span style=\"font-weight: bolder;\">mise en place des dÃ©cisions</span></li></ul><p style=\"margin-bottom: 1rem; text-align: justify;\">Ainsi, la finance est essentielle pour avoir un meilleur aperÃ§u de lâ€™avenir et pour dÃ©terminer si le projet ou les dÃ©cisions prises sont concevables ou non, et sâ€™ils auront des impacts positifs sur le niveau de vie de chacun.</p><p style=\"margin-bottom: 1rem; text-align: justify;\">Par ailleurs, le terme financement dÃ©signe la mise Ã  la disposition dâ€™une personne morale ou physique des ressources financiÃ¨res nÃ©cessaires pour rÃ©aliser un projet.</p><h2 style=\"margin-top: 0px; margin-bottom: 0.5rem; line-height: 1.2; color: rgb(0, 0, 0); text-align: justify; font-size: 22px !important;\">Dans quel domaine peut-on trouver la finance ?</h2><p style=\"margin-bottom: 1rem; text-align: justify;\">Comme dit prÃ©cÃ©demment, la finance a Ã©tÃ© crÃ©Ã©e dans le but dâ€™augmenter les richesses dâ€™une organisation ou dâ€™une entreprise. Par exemple, pour telle somme, on reÃ§oit un bÃ©nÃ©fice Ã©quivalent. Actuellement, on peut trouver la finance dans six domaines bien distincts :</p><ul style=\"margin-bottom: 1rem; padding-left: 0px; text-align: justify;\"><li><a href=\"https://www.ingenieriefinanciere.fr/comment-lire-les-etats-financiers-d-une-entreprise/\" target=\"_blank\" rel=\"noopener\" style=\"color: rgb(84, 121, 224);\">La gestion financiÃ¨re, dans les entreprises</a></li><li>Le placement, dans les institutions financiÃ¨res</li><li>La finance institutionnelle</li><li>La finance internationale</li><li>La finance publique</li><li>La finance personnelle</li></ul><h2 style=\"margin-top: 0px; margin-bottom: 0.5rem; line-height: 1.2; color: rgb(0, 0, 0); font-size: 22px !important;\">Quels sont les mÃ©tiers de la finance ?</h2><p style=\"margin-bottom: 1rem; text-align: justify;\">La finance est un domaine qui englobe de nombreux mÃ©tiers. En effet, il existe diffÃ©rents types de financement et de placement, et chaque mÃ©tier de la finance a son rÃ´le Ã  jouer.</p><p style=\"margin-bottom: 1rem; text-align: justify;\">Les mÃ©tiers de la finance sont variÃ©s, mais on peut les classer en quatre grandes catÃ©gories :</p><ul style=\"margin-bottom: 1rem; padding-left: 0px;\"><li>les banques et les Ã©tablissements de crÃ©dit ;</li><li>les assurances ;</li><li>la gestion de patrimoine ;</li><li>la Bourse.</li></ul><p style=\"margin-bottom: 1rem; text-align: justify;\">Chacune de ces quatre grandes catÃ©gories comporte de nombreux mÃ©tiers diffÃ©rents. Dans les banques et les Ã©tablissements de crÃ©dit, on trouve par exemple les mÃ©tiers de<a href=\"https://www.ingenieriefinanciere.fr/conseils-en-gestion-et-developpement-de-patrimoine/\" style=\"color: rgb(84, 121, 224);\">&nbsp;<span style=\"font-weight: bolder;\">conseiller en gestion de patrimoine</span></a>, de conseiller en investissements financiers, de banquier privÃ©, de courtier en crÃ©dit immobilier, etc.</p><p style=\"margin-bottom: 1rem; text-align: justify;\">Dans les assurances, on trouve les mÃ©tiers dâ€™agent gÃ©nÃ©ral dâ€™assurances, de courtier en assurances, de contrÃ´leur des assurances, de gestionnaire de sinistres, etc.</p><p style=\"margin-bottom: 1rem; text-align: justify;\">La gestion de patrimoine est elle-mÃªme un domaine trÃ¨s vaste, et on y trouve les mÃ©tiers de gestionnaire de patrimoine, de conseiller en investissements financiers, de conseiller en gestion de patrimoine, dâ€™asset manager, etc.</p><p style=\"margin-bottom: 1rem; text-align: justify;\">Enfin, la Bourse regroupe les mÃ©tiers de courtier en bourse, de trader, de gÃ©rant de portefeuille, de conseiller en investissements financiers, etc.</p><h2 style=\"margin-top: 0px; margin-bottom: 0.5rem; line-height: 1.2; color: rgb(0, 0, 0); text-align: justify; font-size: 22px !important;\">Quâ€™en est-il de la finance dâ€™entreprise ?</h2><p style=\"margin-bottom: 1rem; text-align: justify;\">Ã‰galement appelÃ©e Â« corporate finance Â», câ€™est une direction qui tient une place prÃ©pondÃ©rante dans une sociÃ©tÃ©. La&nbsp;<a href=\"https://www.ingenieriefinanciere.fr/tout-savoir-sur-la-finance-d-entreprise/\" target=\"_blank\" rel=\"noopener\" style=\"color: rgb(84, 121, 224);\">finance dâ€™entreprise</a>&nbsp;englobe les prÃ©visions, les tableaux de bord, les flux de trÃ©sorerie, les politiques dâ€™investissement, la gestion des risques, la rÃ©gularisation des documents, etc. FormÃ© par le service comptabilitÃ©, il est chargÃ© de plusieurs missions complÃ©mentaires, veille Ã  ce que les dÃ©penses ne soient pas hors budget et rÃ©unit les fonds nÃ©cessaires Ã  une date donnÃ©e pour financer les activitÃ©s de la firme.</p><p style=\"margin-bottom: 1rem; text-align: justify;\">Qui plus est, la<span style=\"font-weight: bolder;\">&nbsp;comptabilitÃ© dÃ©finition&nbsp;</span>est la suivante : câ€™est un systÃ¨me qui permet de connaitre la situation de la sociÃ©tÃ© en temps rÃ©el. Câ€™est un outil de gestion trÃ¨s efficace pour aider les dirigeants Ã  la prise de dÃ©cision. En somme, la mise en place dâ€™un outil performant est indispensable afin dâ€™avoir un rÃ©sultat pertinent et fiable. En France, les informations doivent rÃ©pondre aux obligations lÃ©gales et Ãªtre conformes Ã  la&nbsp;<span style=\"font-weight: bolder;\">loi de finances</span>&nbsp;pour Ãªtre valables.</p><div id=\"Header_wrapper\"><div id=\"Subheader\"><div class=\"container\" style=\"width: 510px; max-width: 720px;\"><div class=\"column one\"><h2 class=\"title\" style=\"margin-top: 0px; margin-bottom: 0.5rem; line-height: 1.2; color: rgb(0, 0, 0); font-size: 22px !important;\">DiffÃ©rence entre Ã©conomie et finance</h2></div></div></div></div><div id=\"Content\"><div id=\"post-450\">Actuellement la crise Ã©conomique et financiÃ¨re, font la une des actualitÃ©s. Et lâ€™on constate que ces deux situations semblent Ãªtre sans fin. Pour distinguer la&nbsp;<a href=\"https://www.ingenieriefinanciere.fr/difference-entre-economie-et-finance/\" target=\"_blank\" rel=\"noopener\" style=\"color: rgb(84, 121, 224);\">diffÃ©rence entre lâ€™Ã©conomie&nbsp;et la&nbsp;finance</a>,&nbsp;deux concepts similaires ou confus, il est primordial dâ€™expliquer leur diffÃ©rence.</div><div><h2 class=\"title\" style=\"margin-top: 0px; margin-bottom: 0.5rem; line-height: 1.2; color: rgb(0, 0, 0); font-size: 22px !important;\">DiffÃ©rence entre finance et comptabilitÃ©</h2></div><div><p style=\"margin-bottom: 1rem; text-align: justify;\">Finance et comptabilitÃ© sont deux domaines Ã©troitement liÃ©s. Ils peuvent sembler similaires, mais ils ont des fonctions et des objectifs diffÃ©rents. La finance est lâ€™Ã©tude des moyens par lesquels les entreprises, les gouvernements et les particuliers gÃ¨rent et investissent leurs fonds. La comptabilitÃ©, quant Ã  elle, est la science qui traite de lâ€™enregistrement, de lâ€™analyse et de lâ€™interprÃ©tation des donnÃ©es financiÃ¨res.</p><p style=\"margin-bottom: 1rem; text-align: justify;\">Les deux domaines sont Ã©troitement liÃ©s, car la comptabilitÃ© est la base de la finance. Les donnÃ©es comptables sont utilisÃ©es par les financiers pour&nbsp;<span style=\"font-weight: bolder;\">prendre des dÃ©cisions dâ€™investissement</span>&nbsp;et de&nbsp;<span style=\"font-weight: bolder;\">gestion des fonds</span>. Cependant, il y a quelques diffÃ©rences clÃ©s entre ces deux domaines.</p><p style=\"margin-bottom: 1rem; text-align: justify;\">La finance est plus axÃ©e sur le futur, tandis que la comptabilitÃ© se concentre sur le passÃ©. Les financiers utilisent les donnÃ©es comptables pour analyser les tendances et prÃ©voir les rÃ©sultats futurs. Les comptables, quant Ã  eux, enregistrent et analysent les donnÃ©es financiÃ¨res pour Ã©tablir les Ã©tats financiers de lâ€™entreprise. Ces Ã©tats financiers prÃ©sentent une vue historique de la performance de lâ€™entreprise.</p><p style=\"margin-bottom: 1rem; text-align: justify;\">La finance est plus thÃ©orique, tandis que la comptabilitÃ© est plus pratique. Les financiers Ã©tudient les mÃ©canismes qui sous-tendent les marchÃ©s financiers et les dÃ©cisions dâ€™investissement. Les comptables, quant Ã  eux, mettent en Å“uvre les principes comptables pour enregistrer et analyser les donnÃ©es financiÃ¨res.</p><p style=\"margin-bottom: 1rem; text-align: justify;\">La finance est plus orientÃ©e vers le risque, tandis que la comptabilitÃ© est plus orientÃ©e vers la prÃ©cision. Les financiers doivent prendre des dÃ©cisions sur les investissements Ã  risque, tels que les actions ou les obligations. Les comptables, quant Ã  eux, doivent sâ€™assurer que les donnÃ©es financiÃ¨res sont correctes et prÃ©cises.</p></div><div id=\"post-450\"><div></div></div><div><div class=\"rll-youtube-player\" data-src=\"https://www.youtube.com/embed/IiuSMEzEdcI\" data-id=\"IiuSMEzEdcI\" data-query=\"\" style=\"position: relative; padding-bottom: 286.766px; height: 0px; overflow: hidden; max-width: 100%;\"><div data-id=\"IiuSMEzEdcI\" data-query=\"\" data-src=\"https://www.youtube.com/embed/IiuSMEzEdcI\"><img data-lazy-src=\"https://i.ytimg.com/vi_webp/IiuSMEzEdcI/hqdefault.webp\" alt=\"\" width=\"480\" height=\"360\" data-ll-status=\"loaded\" class=\"entered lazyloaded\" src=\"https://i.ytimg.com/vi_webp/IiuSMEzEdcI/hqdefault.webp\" style=\"border-width: initial; border-style: none; inset: 0px; display: block; margin: auto; max-width: 100%; width: 510px; position: absolute; height: auto; transition: all 0.4s ease 0s;\"><button class=\"play\" aria-label=\"play Youtube video\" style=\"border-radius: 0px; height: 286.766px; width: 510px; left: 0px; top: 0px; position: absolute; background-image: url(&quot;https://www.ingenieriefinanciere.fr/wp-content/plugins/wp-rocket/assets/img/youtube.png&quot;); background-position: center center; background-size: initial; background-repeat: no-repeat; background-attachment: initial; background-origin: initial; background-clip: initial; border-width: initial; border-style: none; border-color: initial;\"></button></div></div></div><div></div><h2 style=\"margin-top: 0px; margin-bottom: 0.5rem; line-height: 1.2; color: rgb(0, 0, 0); font-size: 22px !important;\">Quelles Ã©tudes pour faire de la finance ?</h2><p style=\"margin-bottom: 1rem; text-align: justify;\">La finance est un domaine qui attire de plus en plus de jeunes. En effet, les mÃ©tiers de la finance offrent de nombreux avantages, notamment des&nbsp;<span style=\"font-weight: bolder;\">salaires Ã©levÃ©s</span>&nbsp;et des perspectives dâ€™Ã©volution intÃ©ressantes. Cependant, pour pouvoir exercer ces mÃ©tiers, il est nÃ©cessaire de suivre des Ã©tudes spÃ©cialisÃ©es.</p><p style=\"margin-bottom: 1rem; text-align: justify;\">AprÃ¨s le baccalaurÃ©at, de nombreux Ã©tudiants choisissent de suivre des Ã©tudes de commerce, car elles permettent dâ€™acquÃ©rir les connaissances nÃ©cessaires pour travailler dans le domaine de la finance. Les Ã©tudes de commerce sont gÃ©nÃ©ralement composÃ©es de diffÃ©rentes matiÃ¨res, telles que les mathÃ©matiques, la gestion, la comptabilitÃ©, etc.</p><p style=\"margin-bottom: 1rem; text-align: justify;\">AprÃ¨s avoir obtenu le diplÃ´me de commerce, il est possible de suivre des Ã©tudes de finance spÃ©cialisÃ©es, comme le master en finance. Ces Ã©tudes permettent dâ€™acquÃ©rir les connaissances thÃ©oriques et pratiques nÃ©cessaires pour exercer les mÃ©tiers de la finance.</p><p style=\"margin-bottom: 1rem; text-align: justify;\">Il est Ã©galement possible de suivre des Ã©tudes de droit, notamment si vous souhaitez exercer le mÃ©tier dâ€™avocat. En effet, le droit est une matiÃ¨re qui est souvent liÃ©e Ã  la finance, car elle permet dâ€™acquÃ©rir les connaissances nÃ©cessaires pour gÃ©rer les diffÃ©rents aspects juridiques des affaires financiÃ¨res.</p></div></div><div class=\"related\" style=\"margin-bottom: 10px; font-size: 18px;\">Dans la mÃªme catÃ©gorie</div><div class=\"post-element\"><a href=\"https://www.ingenieriefinanciere.fr/cacf-comment-gerer-son-compte-au-credit-agricole-consumer-finance/\" style=\"color: rgb(84, 121, 224);\">CACF : Comment gÃ©rer son compte au CrÃ©dit Agricole Consumer Finance ?</a></div><div class=\"post-element\"><a href=\"https://www.ingenieriefinanciere.fr/les-banques-et-le-moi-numerique-une-nouvelle-phase-de-leconomie-numerique/\" style=\"color: rgb(84, 121, 224);\">Les banques et le Â«&nbsp;moi numÃ©rique&nbsp;Â» : une nouvelle phase de lâ€™Ã©conomie numÃ©rique</a></div></div></div></div>',5,'2023-06-28 09:55:42',1),(324,58,'INDENTATION ET COMMENTAIRES','<p style=\"text-align: center; \"><iframe frameborder=\"0\" src=\"//www.youtube.com/embed/IiuSMEzEdcI\" width=\"640\" height=\"360\" class=\"note-video-clip\"></iframe><br></p>',5,'2023-06-28 10:01:34',1),(325,58,'INDENTATION ET COMMENTAIRES','<p><br></p><table class=\"table table-bordered\"><tbody><tr><td><br></td><td><br></td><td><br></td><td><br></td></tr><tr><td><br></td><td><br></td><td><br></td><td><br></td></tr><tr><td><br></td><td><br></td><td><br></td><td><br></td></tr><tr><td><br></td><td><br></td><td><br></td><td><br></td></tr><tr><td><br></td><td><br></td><td><br></td><td><br></td></tr></tbody></table><p><br></p>',5,'2023-07-01 20:25:34',1),(326,60,'INDENTATION ET COMMENTAIRES','<p><br></p><table class=\"table table-bordered\"><tbody><tr><td><br></td><td><br></td><td><br></td><td><br></td></tr><tr><td><br></td><td><br></td><td><br></td><td><br></td></tr><tr><td><br></td><td><br></td><td><br></td><td><br></td></tr><tr><td><br></td><td><br></td><td><br></td><td><br></td></tr><tr><td><br></td><td><br></td><td><br></td><td><br></td></tr><tr><td><br></td><td><br></td><td><br></td><td><br></td></tr></tbody></table><p><br></p>',27,'2023-07-01 21:16:48',1),(327,58,'ESP 32 test','<p style=\"text-align: center; \"><img src=\"data:image/jpeg;base64,\" style=\"width: 479.641px; height: 239.82px;\" data-filename=\"71Jd0D80GbL._AC_SL1500_.jpg\"></p><h2 style=\"text-align: justify; \">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; <span style=\"font-family: &quot;Times New Roman&quot;;\">Evaluation des mesures qui ont Ã©tÃ© adoptÃ©es depuis le dernier audit rÃ©alisÃ© et aux \r\ninsuffisances enregistrÃ©es dans lâ€™application de ses recommandations, avec un report des raisons \r\ninvoquÃ©es par les responsables du systÃ¨me dâ€™information et celles constatÃ©es, expliquant ces \r\ninsuffisances.&nbsp;</span></h2><p><br></p>',5,'2023-07-01 22:27:12',1),(328,61,'Programmation informatique','<p><div style=\"text-align: center;\"><br></div><div style=\"text-align: center;\"><img src=\"data:image/png;base64,\" data-filename=\"Capture_js.PNG\" style=\"width: 852.777px; height: 426.388px;\"></div></p>',28,'2023-07-02 12:55:58',1),(329,58,'','<p><br></p><table class=\"table table-bordered\"><tbody><tr><td><br></td><td><br></td><td><br></td><td><br></td></tr><tr><td><br></td><td><br></td><td><br></td><td><br></td></tr></tbody></table><p><img src=\"data:image/jpeg;base64,\" style=\"width: 1269.46px; height: 634.729px;\" data-filename=\"61L4G6PFUNL._AC_SL1500_.jpg\"><br></p>',5,'2023-07-10 13:21:23',1);
